import { INCREMENT,DECREMENT} from './tipe'

const INITIAL_STATE = {
    count : 0
};

export function counterReducer(state= INITIAL_STATE, action) {
    switch (action,type) {
        case INCREMENT:
            return { count: state.count + 1 }
          
        case DECREMENT:
            return { count: state.count - 1 }
          
        default:
            throw new Error();
          
    }
}
